import { StatusBar } from "expo-status-bar";
import React from "react";
import {
  StyleSheet,
  Text,
  TouchableOpacity,
  Image,
  View,
  SafeAreaView,
  Button,
  Platform,
} from "react-native";

export default function App() {
  const handlePress = () => console.log("I pressed it");
  console.log(require("./assets/icon.png"));
  return (
    <SafeAreaView style={styles.container}>
      <Text>USC Visitors App</Text>

      <TouchableOpacity onPress={() => console.log("hello")}>
        <Image
          source={require("./assets/undrawMap.png")}
          style={{
            height: 300,
            width: 400,
          }}
        />
      </TouchableOpacity>
      <Button
        color="maroon"
        title="click me"
        onPress={() => console.log("yooo")}
      />
      <Text onPress={handlePress}>David, Sarah, Morice</Text>
      <StatusBar style="auto" />
    </SafeAreaView>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#fff",
    alignItems: "center",
    justifyContent: "center",
  },
});

const boxShadow = styled.Image`
  box-shadow: 10px 5px 5px black;
`;
